import { Grid } from "@mui/material";
import Leftbar from "./components/Leftbar";
import Navbar from "./components/Navbar";

const App = () => {
  return (
    <div>
      <Leftbar />
      <Grid container>
        <Grid>
          <Navbar />
        </Grid>
      </Grid>
    </div>
  );
};

export default App;
